import React from "react";
import Todo from "./Todo";
import { Consumer } from "../context";

class Todos extends Component {
  state = {};
  render() {
    return (
      <Consumer>
        {(value) => {
          const { todos } = value;
          return todos.map((todo) => {
            <Todo task={todo} />;
          });
        }}
      </Consumer>
    );
  }
}

export default Todos;
